export default class Map extends React.Component {
    constructor(props) {
        super(props);
        this.initMap = this.initMap.bind(this);
        this.state = {};
    }

    initMap() {
        if (typeof window == 'undefined') {
            return;
        }

        this.setState({
            _mapInit: true
        });
        var latLng = new window.google.maps.LatLng(points[0].geometry.coordinates[1], points[0].geometry.coordinates[0]
        );

        var map = new window.google.maps.Map(this.GoogleMap, {
            zoom: 16,
            center: latLng,
            mapTypeId: window.google.maps.MapTypeId.ROADMAP,
            disableDefaultUI: true,
            gestureHandling: "gestureHandling",

        });


        var marker = new window.google.maps.Marker({
            position: latLng,
            map: map,
        });

        let idx = 0;


        let arr = [];

        const timer = setInterval(() => {

            if (arr.length >= 30 || idx >= points.length ) {

                fetch(`https://localhost:8080/tracking/${this.state.order.carId}/track`, {
                    method: 'POST',
                    headers: {
                        'Content-Type': 'application/json',
                        'Authorization': `Bearer ${localStorage.getItem('token')}`

                    },
                    body: JSON.stringify({
                        renterId: this.state.order.renterId,
                        ownerId: this.state.order.ownerId,
                        coordinatesArray : arr
                    })
                })

                if (idx >= points.length){
                    clearInterval(timer);
                    return;
                }else{
                    arr = [];
                }

            }


            marker.setPosition(new window.google.maps.LatLng(points[idx].geometry.coordinates[1], points[idx].geometry.coordinates[0]
                ))
                map.setCenter(new window.google.maps.LatLng(points[idx].geometry.coordinates[1], points[idx].geometry.coordinates[0]
                    ))

                arr.push( [[points[idx].geometry.coordinates[1], points[idx].geometry.coordinates[0]], Math.floor(new Date().getTime() / 1000)] );


                
    
                /*if (idx > 50){
                    clearInterval(timer);
                }*/
                idx++;
            }, 50)



    }

    componentDidMount() {
        fetch('https://localhost:8080/orders/', {
            method: 'GET',
            headers: {
                'Content-Type': 'application/json',
                'Authorization': `Bearer ${localStorage.getItem('token')}`
            },
        }).then( (res) => res.json()).then((orders) => {
            for(let i=0;i<orders.length;i++){
                if (orders[i]._id == this.props[0].match.params.id){
                    this.setState({
                        order: orders[i]
                    })
                    break;
                }
            }
        })


    }

    componentDidUpdate() {
        if (this.props._googleMapsLoaded && !this.state._mapInit && this.state.order) {
            this.initMap();
        }
    }

    render() {
        return (
            <>
                <div className="map" ref={(input) => { this.GoogleMap = input; }}>

                </div>

            </>
        );
    }
}
